<!DOCTYPE html>
<html lang="en">
<head>
	<meta charset="UTF-8">
	<title>error||404 page not found</title>
	<meta name="viewport" content="width=device-width,initial-scale=1">
	<link href="https://fonts.googleapis.com/css?family=Share+Tech+Mono" rel="stylesheet">
	<style>
		* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}
body {
    background-color: #2e3037;
    color: #22da26;
    /* green text shadow as glow? */
    font-family: 'Share Tech Mono', monospace;
    padding-top: 10vh;
    height: 100vh;
}
a {
    color: #22da26;
    text-decoration: none;
}
a:hover {
    opacity: .7;
}
img {
    margin: 0 auto;
    display: block;
    width: 100%;
    max-width: 960px;
}
h1 {
    text-align: center;
    margin: 30px 0;
}
.wrapper {
    max-width: 960px;
    margin: 0 auto;
}
.terminalWrap {
    display: flex;
    justify-content: space-between;
}
ul {
    list-style-type: none;
}
li {
    line-height: 1.6;
}
.overlay {
    position: fixed;
    top: -6px;
    left: 0;
    width: 100%;
    height: calc(100% + 6px);
    animation: backgroundScroll 1s linear infinite;
    pointer-events: none;
    background: url(data:image/png;base64,), radial-gradient(ellipse at center, rgba(0,0,0,0) 0,rgba(0,0,0,1) 100%);
}
@keyframes anim404 {
    0% {
        background-color: rgba(34, 218, 38, 0);
        transform: translateY(0) rotate(0.02deg);
    }
    70% {
        background-color: rgba(34, 218, 38, 0.2);
    }
    100% {
        background-color: rgba(34, 218, 38, 0);
        transform: translateY(6px) rotate(0.02deg);
    }
}
@keyframes backgroundScroll {
    from {transform: translateY(0) rotate(0.02deg);}
    to {transform: translateY(6px) rotate(0.02deg);}
}

.terminal div {
    animation: terminal .7s linear both;
    width: 0;
    overflow: hidden;
    white-space: nowrap;
}
.c1 {
    animation-delay: .5s !important;
}
.c2 {
    animation-delay: 1.5s !important;
}
.c3 {
    animation-delay: 2.2s !important;
}
.c4 {
    animation-delay: 2.9s !important;
}
.c5 {
    animation-delay: 3.6s !important;
}
.c6 {
    animation-delay: 4.3s !important;
}
.c7 {
    animation-delay: 5s !important;
}
.c8 {
    animation-delay: 5.7s !important;
}

@keyframes terminal {
    0% {width: 0;}
    100% {width: 100%;}
}

.c8 span {
    animation: blink .5s alternate infinite linear;
    animation-delay: 6.3s;
    opacity: 0;
}
@keyframes blink {
    from {opacity: 0;}
    to {opacity: 100;}
}


@media screen and (max-width: 768px) {
    .wrapper {
        margin: 0 5%;
    }
    .terminal {
        display: none;
    }
}
@media screen and (max-width: 1366px) {
    img {
        max-width: 760px;
    }
}

	</style>
</head>
<body>
<div class="wrapper">
    <img alt="404 Error. Page not found" src="data:image/png;base64,">
    <h1>Page not found</h1>
    <div class="terminalWrap">
        <div class="terminal">
            <p>Terminal</p>
            <br>
            <div class="c1">$ Getting status </div>
            <br>
            <div class="c2">Request returned nothing...</div><!-- Cheesy error page initialized -->
            <div class="c3">search: Locating possible options: 6, done.</div>
            <div class="c4">search: Total 6 returned, reused (6)</div>
            <div class="c5">Receiving main navigation options: 100% (6/6), 268.00 KB/s, done.</div>
            <div class="c6">Attempting to load: 100% (6/6), done.</div>
            <div class="c7">Checking connectivity... done.</div>
            <br>
            <div class="c8">$ -s The cake is a lie<span>|</span></div>
        </div>

        <nav class="navigation">
            <ul>
                <li><a href="#" onclick="goBack()">// Return</a></li>
                <li><a href="#">// Home</a></li>
                <li><a href="#">// About Me</a></li>
                <li><a href="#">// Work</a></li>
                <li><a href="#">// Portfolio</a></li>
                <li><a href="#">// Contact</a></li>
            </ul>
        </nav>
    </div>
</div>
<div class="overlay"></div>

<script>
	function goBack() {
  window.history.back();
}
</script>
</body>
</html>